create or replace view viewStatus as 
select a.fk_nutricionista, a.status_agendamento,count(*) as contador from agendamento a
left join tb_usuarios b
on b.id = a.fk_nutricionista
where b.tipo = 'N' and  status_agendamento =  3 or status_agendamento = 0 or status_agendamento = 1 or status_agendamento = 2 group by  a.fk_nutricionista, a.status_agendamento;






